import React from 'react';
import { useTranslation } from 'react-i18next';

function About() {
  const { t } = useTranslation();

  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold mb-6">{t('about.title', 'About Us')}</h1>
      <div className="prose max-w-none">
        <p className="mb-4">
          {t('about.description', 'Welcome to Nirman Sewa, your trusted partner in construction and development services.')}
        </p>
        <p className="mb-4">
          {t('about.mission', 'Our mission is to provide high-quality construction services while ensuring safety, sustainability, and customer satisfaction.')}
        </p>
        <p>
          {t('about.vision', 'We envision becoming the leading construction service provider, known for our excellence, innovation, and commitment to quality.')}
        </p>
      </div>
    </div>
  );
}

export default About;
